import React from 'react';
import { Link } from 'react-router-dom';
import '../../styles/Dashboard.module.css';

const VetDashboard = () => {
  return (
    <div className="dashboard-container">
      <h2>Veterinarian Dashboard</h2>
      <div className="dashboard-cards">
        <div className="dashboard-card">
          <h3>Health Records</h3>
          <p>View and add medical/vaccination records.</p>
          <Link to="/health-records" className="btn btn-primary">Health Records</Link>
        </div>
        <div className="dashboard-card">
          <h3>Health Alerts</h3>
          <p>Upcoming vaccinations and health alerts.</p>
          <Link to="/health-alerts" className="btn btn-primary">Health Alerts</Link>
        </div>
        <div className="dashboard-card">
          <h3>Cattle</h3>
          <p>View all cattle and their health status.</p>
          <Link to="/cattle" className="btn btn-primary">View Cattle</Link>
        </div>
        <div className="dashboard-card">
          <h3>QR Scanner</h3>
          <p>Scan QR codes for cattle profiles.</p>
          <Link to="/qr-scanner" className="btn btn-primary">QR Scanner</Link>
        </div>
      </div>
    </div>
  );
};

export default VetDashboard;
